
public class Matrix1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[][] a = new int[5][5];
		int i = 0;
		int j = 0;
		
		for (i=0; i<5; i++)
		{
			for (j = 0; j<a.length; j++)
			{
				
				System.out.print(j+1+"\t");	
			}
		System.out.println();
		}
		
		
	}

}
